import { useEffect, useState } from "react";

interface Movie {
  title: string;
  status: string;
}

function Home() {
  const [movie, setMovie] = useState<Movie>();

  useEffect(() => {
    getMovies();
  }, []);

  async function getMovies() {
    const api = await fetch(
      `https://api.themoviedb.org/3/discover/movie?api_key=${process.env.REACT_APP_TMBD_KEY}`
    );
    const result = await api.json();
    setMovie(result);
    console.log(result);
  }

  return (
    <div>
      {movie?.result?.title}
      <div>{movie?.status}</div>
    </div>
  );
}

export default Home;
